import React, { useState } from 'react'


const BookSearchPage = () => {
    return (
        <section>
            <form>
                <span>Search by title or author</span>
                <input
                    type="search"
                    placeholder="Search by title or author"
                />
                <button type="submit">Search</button>
            </form>
        </section>
    )
}

export default BookSearchPage;
